import './style.css';
import PhipsonSVG from './PhipsonSVG';
import { HashRouter } from 'react-router-dom';
import React from 'react';

import LandingPage from './components/Landing';
import NavigationBar from './components/NavigationBar';

const pageIDStyle = [
  {
    background: "linear-gradient(111.2deg, #7C67E4 0%, #4D33CC 100.5%)",
    subtextColor: "#FFEE99",
  },
  {
    background: "linear-gradient(111.2deg, #2258C3 0%, #1F3D7A 100.5%)",
    subtextColor: "#FF9999",
  },
  {
    background: "linear-gradient(111.2deg, #26734C 0%, #244233 100.5%)",
    subtextColor: "#FFCC99"
  }
]

class App extends React.Component{
  constructor (props) {
    super(props);
    this.state = {
      pageID: 0, // FOR LANDING PAGE
      siteState: 0, // FOR NAVIGATION
      headerText: "",  // FOR NAVIGATION DISPLAY (SYSTEM STATUS)
    }
  }

  render () {
    return (
      <HashRouter basename='/'>
        <div className="App">
          <NavigationBar title={this.state.headerText}/>
          <LandingPage pageID={this.state.pageID}/>
        </div>
      </HashRouter>
    );
  }
}

export default App;
